import React, {Component} from "react";
import { Row, Col } from "react-bootstrap";

class Film extends Component{
    render() { 
        return (
        <Row>
            <Col key={this.props.data.Id}>{this.props.data.Id}</Col>
            <Col key={this.props.data.Id}>{this.props.data.Title}</Col>
            <Col key={this.props.data.Id}>{this.props.data.AvgGrade}</Col>
        </Row>
    )}
}

export default Film;
